body{
    background-color: white;
}

.wrapper{
    width: 100%;
    height: 100vh;
}

.mainImage{
    display: flex;
    align-self: center;
    justify-self: center;

    .covidHalf{
        display: none;
        width: 225px;
        height: 450px;

        @media only screen and (max-width: 1100px){
            display: block;
        }

        @media only screen and (max-width: 500px){
            width: 180px;
            height: 350px;
        }
    }

    .covidFull{
        width: 450px;
        @media only screen and (max-width: 1100px){
            display: none;
        } 
    }

    @media only screen and (max-width: 1100px){
        justify-self: flex-end;
    }
}

.left{
    align-items: center;
    justify-items: flex-start;
    // margin-left: 3rem;

    p{
        font-size: 3rem;
        font-family: 'Oswald', sans-serif;
        font-weight: 400;
        letter-spacing: .8rem;
        padding-left: 2rem;

        @media only screen and (max-width: 830px){
            font-size: 2.5rem;
        }

        @media only screen and (max-width: 600px){
            font-size: 2rem;
        }

    }

    #casses{
        align-self: flex-end;
        margin-bottom: 3rem;
        border-left: 1.5px solid black;
    }

    #viewCountry{
        margin-top: 10rem;
        font-size: 2rem;
        align-self: flex-end;
    }

    #deaths{
        color: #D31311;
        border-left: 1.5px solid #D31311;
    }

    #recovered{
        color: #15A83C;
        border-left: 1.5px solid #15A83C;
        align-self: flex-start;
        margin-top: 4rem;
    }
}

.right{
    align-items: center;
    justify-items: center;

    p{
        align-self: flex-end;
        color: #D31311;
        font-size: 10rem;
        font-family: 'Oswald', sans-serif;
        font-weight: 500;
        letter-spacing: 3rem;
        line-height: 12rem;
        padding-left: 35%;

        @media only screen and (max-width: 1100px){
            display: flex;
            justify-content: center;
            padding-left: 0; 
            height: 100vh;
            width: 100%;
        }

        @media only screen and (max-width: 1000px){
            font-size: 7rem;
        }

        @media only screen and (max-width: 700px){
            font-size: 5rem;
        }

        @media only screen and (max-width: 600px){
            font-size: 4rem;
        }

        @media only screen and (max-width: 500px){
            font-size: 3rem;
        }

        @media only screen and (max-width: 400px){
            font-size: 2rem;
        }

        &:last-child{
            align-self: flex-start;
        }

    }

    .logo{
        padding-left: 30%;
        img{
            width: 180px;
        }

        @media only screen and (max-width: 1100px){
            display: flex;
            position: absolute;
            padding-left: 0;
            left: 10%;
            right: 0;
            justify-content: center;
        }

        @media only screen and (max-width: 830px){
            justify-content: center;
            align-self: flex-end;
            padding-bottom: 2rem;
        }

        @media only screen and (max-width: 500px){
            img{
                width: 150px;
            }
        }

    }

    @media only screen and (max-width: 1100px){
        flex-direction: row;
        align-self: flex-start;
    }
}

